import React, { Component } from 'react';
import AppNav from './AppNav';

class Home extends Component {
    state = {}

    render() { 
        return (
            <div>
             <AppNav/>
             <h2 style={{display: 'flex',  justifyContent:'center', alignItems:'center', height: '100vh'}}>
               Welcome to the best Invo tracker app!
               </h2>
              </div>
            );
    }
}

export default Home;
